let x = 100,
  y = 100;
let x2 = 300,
  y2 = 300;

let mask;

function preload(){
  mask = loadImage('data:image/png;base64,')
}

function setup() {
  let canvas = createCanvas(800, 800);
  canvas.parent('sketchContainer')
  background(0);
}

function draw() {
  
  image(mask,0,0,width,height)
  
  stroke(255);
  background(0,0,0,0.5);
  let speed = 100;

  for (let i = 0; i < speed; i++) {
    point(x, y);
    point(x2, y2);

    let speed = width/200;

    if (random([1, 2]) == 1) {
      x += speed;
    } else {
      x -= speed;
    }

    if (random([1, 2]) == 1) {
      y += speed;
    } else {
      y -= speed;
    }

    if (random([1, 2]) == 1) {
      x2 += speed;
    } else {
      x2 -= speed;
    }

    if (random([1, 2]) == 1) {
      y2 += speed;
    } else {
      y2 -= speed;
    }

    if (x >= width) x = 0;

    if (x < 0) x = width - 1;

    if (y >= height) y = 0;

    if (y < 0) y = height - 1;

    if (x2 >= width) x2 = 0;

    if (x2 < 0) x2 = width - 1;

    if (y2 >= height) y2 = 0;

    if (y2 < 0) y2 = height - 1;
  }
}
